package com.mem.vo.business.base.model.po;import java.util.Date;/** * <br> * <b>功能：</b>Picture实体类<br> */public class Picture {    /**     *     */    private Long id;    /**     *     */    private String thumbUrl;    /**     *     */    private String url;    /**     * 图片分类  1 用于推荐 2  用于演出     */    private String type;    /**     *     */    private Date createTime;    /**     *     */    private String createUser;    /**     *     */    private Date updateTime;    /**     *     */    private String updateUser;    /**     * 删除标识  0 有效 1 无效     */    private Integer isDelete;    /**     *     */    private Date ts;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public String getThumbUrl() {        return this.thumbUrl;    }    public void setThumbUrl(String thumbUrl) {        this.thumbUrl = thumbUrl;    }    public String getUrl() {        return this.url;    }    public void setUrl(String url) {        this.url = url;    }    public String getType() {        return this.type;    }    public void setType(String type) {        this.type = type;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getCreateUser() {        return this.createUser;    }    public void setCreateUser(String createUser) {        this.createUser = createUser;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public String getUpdateUser() {        return this.updateUser;    }    public void setUpdateUser(String updateUser) {        this.updateUser = updateUser;    }    public Integer getIsDelete() {        return this.isDelete;    }    public void setIsDelete(Integer isDelete) {        this.isDelete = isDelete;    }    public Date getTs() {        return this.ts;    }    public void setTs(Date ts) {        this.ts = ts;    }}